/**
 * Relation Component
 * -------------------------------------
 * Draws a UML-style line from source class to target class.
 */

import React from "react";
import PropTypes from "prop-types";

const Relation = ({
  source,
  target,
  type,
  sourceCardinality,
  targetCardinality,
  classWidth = 200,
  classHeight = 100,
}) => {
  if (!source || !target) return null;

  // Calculate centers of the classes
  const centerX1 = source.x + classWidth / 2;
  const centerY1 = source.y + classHeight / 2;
  const centerX2 = target.x + classWidth / 2;
  const centerY2 = target.y + classHeight / 2;

  // Calculate angle and distance
  const dx = centerX2 - centerX1;
  const dy = centerY2 - centerY1;
  const angle = Math.atan2(dy, dx);
  const distance = Math.sqrt(dx * dx + dy * dy);

  if (distance < 10) return null;

  // Simple intersection points calculation
  const start = {
    x: source.x + (dx > 0 ? classWidth : 0),
    y: source.y + classHeight / 2
  };

  const end = {
    x: target.x + (dx < 0 ? classWidth : 0),
    y: target.y + classHeight / 2
  };

  // Generate unique IDs for markers
  const relationId = `relation-${source.x}-${source.y}-${target.x}-${target.y}`;
  const triangleId = `triangle-${relationId}`;
  const diamondHollowId = `diamond-hollow-${relationId}`;
  const diamondFilledId = `diamond-filled-${relationId}`;
  const arrowId = `arrow-${relationId}`;

  // Calculate cardinality positions
  const cardinalityOffset = 20;
  const sourceCardinalityPos = {
    x: start.x + (dx > 0 ? -cardinalityOffset : cardinalityOffset),
    y: start.y - 15
  };

  const targetCardinalityPos = {
    x: end.x + (dx < 0 ? -cardinalityOffset : cardinalityOffset),
    y: end.y - 15
  };

  return (
    <svg
      style={{
        position: "absolute",
        top: 0,
        left: 0,
        width: "100%",
        height: "100%",
        pointerEvents: "none",
        overflow: "visible",
        zIndex: 1
      }}
    >
      <defs>
        {/* Markers definitions */}
        <marker
          id={triangleId}
          viewBox="0 0 10 10"
          refX="9"
          refY="5"
          markerWidth="10"
          markerHeight="10"
          orient="auto"
        >
          <path d="M 0 0 L 10 5 L 0 10 z" fill="white" stroke="black" />
        </marker>

        <marker
          id={diamondHollowId}
          viewBox="0 0 12 12"
          refX="6"
          refY="6"
          markerWidth="12"
          markerHeight="12"
          orient="auto"
        >
          <path d="M 0 6 L 6 0 L 12 6 L 6 12 Z" fill="white" stroke="black" />
        </marker>

        <marker
          id={diamondFilledId}
          viewBox="0 0 12 12"
          refX="6"
          refY="6"
          markerWidth="12"
          markerHeight="12"
          orient="auto"
        >
          <path d="M 0 6 L 6 0 L 12 6 L 6 12 Z" fill="black" stroke="black" />
        </marker>

        <marker
          id={arrowId}
          viewBox="0 0 10 10"
          refX="9"
          refY="5"
          markerWidth="8"
          markerHeight="8"
          orient="auto"
        >
          <path d="M 0 0 L 10 5 L 0 10" fill="none" stroke="black" />
        </marker>
      </defs>

      {/* Main line */}
      <line
        x1={start.x}
        y1={start.y}
        x2={end.x}
        y2={end.y}
        stroke="black"
        strokeWidth="2"
        markerStart={
          type === "aggregation"
            ? `url(#${diamondHollowId})`
            : type === "composition"
            ? `url(#${diamondFilledId})`
            : null
        }
        markerEnd={
          type === "generalization"
            ? `url(#${triangleId})`
            : type === "dependency"
            ? `url(#${arrowId})`
            : null
        }
        strokeDasharray={type === "dependency" ? "4,4" : "none"}
      />

      {/* Source Cardinality */}
      {sourceCardinality && (
        <g>
          <rect
            x={sourceCardinalityPos.x - 15}
            y={sourceCardinalityPos.y - 10}
            width="30"
            height="20"
            fill="white"
            stroke="none"
          />
          <text
            x={sourceCardinalityPos.x}
            y={sourceCardinalityPos.y}
            textAnchor="middle"
            dominantBaseline="middle"
            fill="black"
            fontSize="12"
          >
            {sourceCardinality}
          </text>
        </g>
      )}

      {/* Target Cardinality */}
      {targetCardinality && (
        <g>
          <rect
            x={targetCardinalityPos.x - 15}
            y={targetCardinalityPos.y - 10}
            width="30"
            height="20"
            fill="white"
            stroke="none"
          />
          <text
            x={targetCardinalityPos.x}
            y={targetCardinalityPos.y}
            textAnchor="middle"
            dominantBaseline="middle"
            fill="black"
            fontSize="12"
          >
            {targetCardinality}
          </text>
        </g>
      )}
    </svg>
  );
};

Relation.propTypes = {
  source: PropTypes.shape({
    x: PropTypes.number,
    y: PropTypes.number,
  }).isRequired,
  target: PropTypes.shape({
    x: PropTypes.number,
    y: PropTypes.number,
  }).isRequired,
  type: PropTypes.oneOf([
    "association",
    "aggregation",
    "composition",
    "generalization",
    "dependency",
  ]).isRequired,
  sourceCardinality: PropTypes.string,
  targetCardinality: PropTypes.string,
  classWidth: PropTypes.number,
  classHeight: PropTypes.number,
};

export default Relation;
